import React from "react";

function Card(info,imgSrc,displayPosition) {
  return (

<div class="col-lg-6" data-aos="fade-up" data-aos-delay={displayPosition}>
<div class="team-member d-flex align-items-start">
<div class="pic"><img src={imgSrc} class="img-fluid" alt="" /></div>
  <div class="member-info">
    <h4>{info.name}</h4>
    <span>{info.age}</span>
    <p>{info.email}</p>
    <div class="social">
      <a href=""><i class="bi bi-twitter-x"></i></a>
      <a href=""><i class="bi bi-facebook"></i></a>
      <a href=""><i class="bi bi-instagram"></i></a>
      <a href=""> <i class="bi bi-linkedin"></i> </a>
    </div>
  </div>
</div>
</div>
  );
}





function createCard(card) {
    return (
      <Card
        key={card.id}
        name={card.name}
        src={card.src}
        alt={card.alt}
        tel={card.tel}
        email={card.email}
      />
    );
  }
export default Card;
